import {Box, Stack, Typography} from '@mui/material'

const Header = () => {
  return (
    <div direction='row' alignItems='center' justifyContent='center' style={{position: 'relative', backgroundColor: 'white', height: '40px'}}>
      <Typography style={{backgroundColor: 'white', left: '20%'}} variant='h3'>
        Notes
      </Typography>
    </div>
  )
}

export default Header
